import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

// import all pages
import HomePage from "./pages/HomePage/HomePage";
import EditablePage from "./pages/EditablePage/EditablePage";
import MCPage from "./pages/MakeConfessionPage/MCPage";
import LandingPage from "./pages/LandingPage/LandingPage";

// import NavBar 

export default function App() {
  return (
    <Router>
      <div>
      </div>
        <Switch>
          <Route path="/draft">
            <EditablePage/>
          </Route>
          <Route path="/makeconfession">
            <MCPage/>
          </Route>
          <Route path="/home">
            <HomePage/>
          </Route>
          <Route path="/">
            <LandingPage/>
          </Route>
        </Switch>
    </Router>
  );
}
